import React from 'react';

class Nav extends React.Component {
    render() {
      const { children } = this.props;
      return {
        type: 'nav',        
        props: {
            className: 'top__menu',
            children: [{
                type: 'span',
            }, {
                type: 'ul',
                props: {
                    children: children
                }
            }]
        }
      };
    }
  }

export default Nav;
